import React from "react";
import HomeCardPage from "../Components/HomeCardPage";
import { Switch,Route } from "react-router-dom";

const Routes = () => {
    return ( 
        <>
        <Switch>
            <Route path="/" component={HomePage}/>
        </Switch>

        </>


     );
}
 
export default Routes;
